function MembershipRows({m}) {
    return (
      <tr className="table-row">
          <td className="gym">{m.gym.name}</td>
          <td className="tier">{m.tier.name_of_tier}</td>
          <td className="name">{m.name}</td>
          <td className="email">{m.email}</td>
          <td className="phone">{m.phone}</td>
          <td className="additional-members">{m.attached}</td>
      </tr>
    )
  }

  export default MembershipRows
